const questionsList = [
    {
        imageUrl: require('../images/Shanks.png').default,
        options: [
            'Bulbasaur',
            'Pikachu',
            'Charmander'
        ],
        answer: 'Bulbasaur'
    },
    {
        imageUrl: 'https://cdn.traction.one/pokedex/pokemon/4.png',
        options: [
            'Charmander',
            'Pikachu',
            'Squirtle'
        ],
        answer: 'Charmander'
    },
    {
        imageUrl: 'https://cdn.traction.one/pokedex/pokemon/7.png',
        options: [
            'Squirtle',
            'Bulbasaur',
            'Charmander'
        ],
        answer: 'Squirtle'
    },
    {
        imageUrl: 'https://cdn.traction.one/pokedex/pokemon/25.png',
        options: [
            'Bulbasaur',
            'Pikachu',
            'Charmander'
        ],
        answer: 'Pikachu'
    }
]

export default questionsList;
